  \"Environmental Assessment Proposal to Protect Wildlife Habitat at Lake Umbagog
  1991\",\n\t\"tracking_summary\": {\n\t\t\"total\": 4,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:26.850956\",\n\t\"name\":
  \"environmental-assessment-proposal-to-protect-wildlife-habitat-at-lake-umbagog-1991\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this United States Fish
  & Wildlife Service proposal is to ensure the long-term protection of unique wetland
  habitats adjacent to Lake Umbagog, on the northern New Hampshire/Maine border. These
  extensive wetlands serve as important breeding and migration habitat for many wetland-dependent
  migratory wildlife species of current concern to the Service. The proposal includes
  wetlands and portions of associated surrounding uplands, and would protect habitat
  for the endangered bald eagle and peregrine falcon, waterfowl species of priority
  such as the declining black duck, and many species of federal and state management
  concern including the common loon, northern harrier, American woodcock, and others.
  The proposal will serve to protect unique habitats that support a variety of migratory
  bird and resident mammal, fish, reptile, amphibian, invertebrate, and rare plant
  species, and will thereby contribute to the conservation of biological diversity
  in the northeastern United States. The Environmental Assessment addresses the threats
  to important fish and wildlife habitat in the study areas. Various alternatives
  for protection of these important habitats are presented.\",\n\t\"license_title\":
